import Map from './Map';


const App: React.FC = () => {
  return (
    <div className="flex flex-col m-10">
      <h1 className="text-3xl text-white font-bold m-4 p-10" style={{backgroundColor:'midnightblue', padding:10}}>Eras Tour Tracker</h1>
      <h2 className="text-2xl font-bold m-4 bg-grey-100">Next tour location:</h2>
      <div className="m-10 p-5 bg-white shadow-md">
        <img src="./images/eras-tour.png" alt="Eras Tour" />
      </div>
      <Map/>
    </div>
  );
};

export default App;
